export default function Piano() {
    const pianoText = [
        "Piano-playing is my main artistic background, and has been a central part of my artistic identity since I started playing when I was 6 years old. I played on a high level as a teenager, and participated in a few competitions. In my 20’s I abandoned the piano for a while. In later years, since I started teaching piano, I have taken up my piano playing again, and enjoy playing a wide variety of musical styles - especially the transcendental piano works of the romantic era and beyond. Here’s a little selection.",
        <br key="break" />,
        "Monrad has a quite conservative approach in his works for traditional instruments, which nevertheless often combines traditional musical idioms with humorous or satirical content. On the other hand, Monrad has been working with numerous musical experiments especially projects including algorithmic composition for digital media: for example music-generating computer games, interactive musical setups with quadcopters and programming of musical apps for iPhone and iPad - in collaborations with Copenhagen Game Collective and artists group Haandholdt for whom he developed the iPhone app \"Virtuoso\" in 2014, among others."
    ];

    return (
        <div className="p-4 text-black bg-white bg-opacity-35 text-center">
            <p className="mb-4">{pianoText}</p>
        </div>
    );
}

/*
Piano-playing is my main artistic background, and has been a central part of my artistic identity since I started playing when I was 6 years old. I played on a high level as a teenager, and participated in a few competitions. In my 20’s I abandoned the piano for a while. In later years, since I started teaching piano, I have taken up my piano playing again, and enjoy playing a wide variety of musical styles - especially the transcendental piano works of the romantic era and beyond. Here’s a little selection.
